import { BrowserRouter as  Router, Route } from "react-router-dom";
import Home from "./pages/Home.jsx";
import ExpenseTracker from "./pages/ExpenseTracker";


function App() {

  return (
      <div className="App">
        <Router>
            <Routes>
            <Route path="/" exact>
              <Home />
            </Route>
            <Route path="/products" exact>
              <ExpenseTracker />
            </Route> 
            </Routes>
        </Router>
      </div>
  );
}
export default App;
